var handleBootstrapWizards = function () {
        "use strict";
        $("#wizard").smartWizard({
            selected: 0,
            theme: "default",
            transitionEffect: "",
            transitionSpeed: 0,
            useURLhash: !1,
            showStepURLhash: !1,
            toolbarSettings: {
                toolbarPosition: "bottom"
            }
        })
    },
    FormWizard = function () {
        "use strict";
        return {
            init: function () {
                handleBootstrapWizards()
            }
        }
    }();
